sys_variable_value.value:
(function execute(inputs, outputs) {
    var user = inputs.user_id.toString();

    var dt = new sn_dt.DecisionTableAPI();
    var allDecisions = dt.getAll().result;

    var decisionAnswers = {};

    //Add distinct answers for each decision to the decisionAnswers object
    for (var i = 0; i < allDecisions.length; i++) {
        decisionAnswers[allDecisions[i].name] = allDecisions[i].distinctAnswers;
    }

    //Loop through decision answers to find decisions with the user as the answer
    var userDecisions = [];
    for (var decision in decisionAnswers) {
        for (var i = 0; i < decisionAnswers[decision].length; i++) {
            for (var j = 0; j < decisionAnswers[decision][i].answerElementValues.length; j++) {
                if (decisionAnswers[decision][i].answerElementValues[j].value == user) {
                    userDecisions.push(decision);
                }
            }
        }
    }

    outputs.user_decisions = userDecisions;
    outputs.does_exist_in_decisions = userDecisions.length > 0;
    outputs.decision_count = parseInt(userDecisions.length);
})(inputs, outputs);

